          'SSG Raymond Hoback and his older brother PVT Bedford Hoback. They were in Able Company 116th Infantry Regiment 29th Division. Both Bedford and Raymond became sergeants during their time in England. Raymond ended up a staff sergeant, but Bedford was busted back to private for a disciplinary issue.\n\nNeither made it off Omaha Beach- when the telegram arrived in Bedford Virginia at their parents house they family was stunned to learn Raymond was Killed in Action. The next day as their 3 sisters tried to comfort their parents another telegram arrived to tell the parents their other son Bedford was also dead.\n\nTheir sister Lucille said time stopped for the family that day.\n\nRaymond was thought to have drowned while wounded an unable to move as the tide came in. His remains were never recovered though his pocket bible was found and mailed home. Bedford was hit by Shrapnel  and bled out. He is buried at  Colleville-sur-Mer US Cemetery. Of the 35 men of Able company from Bedford Virginia  19 were killed on D-Day and 4 more would die before the breakout. No other town in America suffered a greater per capita loss in WW2. Of the 200 man company within an hour, 133 were killed and most of the rest wounded',
